import React from "react";
import { Drawer, withStyles } from "@material-ui/core";

const styles = {};

const DrawerComponent = ({ status, toggle }) => {
  return (
    <Drawer anchor="right" open={status} onClose={toggle}>
      <div
        tabIndex={0}
        role="button"
        onClick={this.filter_toggle}
        onKeyDown={this.filter_toggle}
      />
    </Drawer>
  );
};

export default withStyles(styles)(DrawerComponen);
